"""
Given an integer array nums, find the contiguous subarray
within an array (containing at least one number) which has
the largest product.
"""

class Solution(object):
    def maxProduct(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """
        n = len(nums)
        if not n:
            return 0
        product = prev_l = prev_s = nums[0]
        for i in range(1, n):
            smallest = min(nums[i], nums[i] * prev_l, nums[i] * prev_s)
            largest = max(nums[i], nums[i] * prev_l, nums[i] * prev_s)
            prev_s = smallest
            prev_l = largest
            product = max(product, largest)
        return product

def maxSubArraySum(a): 
    global_max = float('-inf')
    local_max = 0
       
    for i in range(0, len(a)): 
        local_max = local_max + a[i] 
        if (global_max < local_max): 
            global_max = local_max 
  
        if local_max < 0: 
            local_max = 0   
    return global_max 

